import "./App.css";
import Header from "./Home/Header";
import Footer from "./Home/Footer";
import { Route, Routes } from "react-router-dom";
import routes from "./Home/routes";
import Layout from "./Layout";
import ProfessorDetails from "./Professors/ProfessorDetails";
import CourseDetails from "./Courses/CourseDetails";

function App() {
  const components = (
    <Routes>
      {routes.map((e, i) => (
        <Route key={i} path={e.path} element={e.component} />
      ))}

      <Route path="professors/:id" element={<ProfessorDetails />} />
      <Route path="courses/:id" element={<CourseDetails />} />
      <Route path="/professors/editprofessor/:id" element={<CourseDetails />} />
      <Route path="/professors/editprofessor" element={<CourseDetails />} />
    </Routes>
  );

  return (
    <>
      <Header />
      <Layout components={components} />
      <Footer />
    </>
  );
}

export default App;
